import React, { useState } from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [openMenu, setOpenMenu] = useState(null);

  const toggleMenu = (menu) => {
    setOpenMenu(openMenu === menu ? null : menu);
  };

  return (
    <header>
      {/* TOP ROW */}
      <div className="top-nav">
        <div className="left-items">
          <Link to="/equipment">Equipment</Link>
          <Link to="/news">News</Link>
          <Link to="/careers">Careers</Link>
          <Link to="/contact">Contact</Link>
        </div>
        <div className="right-items">
          <Link className="orange-btn" to="/apply">DRIVER APPLICATION</Link>
          <Link className="orange-btn" to="/loadtrack">LOADTRACK!</Link>
          <Link className="login-btn" to="/login">LOGIN</Link>
        </div>
      </div>

      {/* BOTTOM ROW NAV MENU */}
      <nav className="main-nav">
        <ul>
          <li onMouseEnter={() => toggleMenu("drive")} onMouseLeave={() => setOpenMenu(null)}>
            <Link to="/drive-for-rgm">DRIVE FOR RGM ▾</Link>
            {openMenu === "drive" && (
              <div className="dropdown">
                <Link to="/drive/company">Company Drivers</Link>
                <Link to="/drive/lease">Lease Program</Link>
                <Link to="/drive/requirements">Requirements</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => toggleMenu("transport")} onMouseLeave={() => setOpenMenu(null)}>
            <Link to="/transportation">TRANSPORTATION SOLUTIONS ▾</Link>
            {openMenu === "transport" && (
              <div className="dropdown">
                <Link to="/transport/flatbed">Flatbed Services</Link>
                <Link to="/transport/delivery">Delivery</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => toggleMenu("logistics")} onMouseLeave={() => setOpenMenu(null)}>
            <Link to="/logistics">RGM LOGISTICS ▾</Link>
            {openMenu === "logistics" && (
              <div className="dropdown">
                <Link to="/logistics/services">Logistics Services</Link>
                <Link to="/logistics/network">Nationwide Network</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => toggleMenu("carriers")} onMouseLeave={() => setOpenMenu(null)}>
            <Link to="/carriers">CARRIERS ▾</Link>
            {openMenu === "carriers" && (
              <div className="dropdown">
                <Link to="/carriers/partners">Partner With RGM</Link>
                <Link to="/carriers/support">Carrier Support</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => toggleMenu("company")} onMouseLeave={() => setOpenMenu(null)}>
            <Link to="/company">OUR COMPANY ▾</Link>
            {openMenu === "company" && (
              <div className="dropdown">
                <Link to="/company/about">About Us</Link>
                <Link to="/company/mission">Mission & Values</Link>
                <Link to="/company/leadership">Leadership</Link>
              </div>
            )}
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
